// AppRouter.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';

import HomePage from './pages/home';
import RoomView from './pages/roomview';
import GroupRoomView from './component/room/GroupRoom';
import SingleRoom from './component/room/SingleRoom';

const AppRouter = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/roomview" element={<RoomView />} />
        <Route path="/single-room-view" element={<SingleRoom/>} />
        <Route path="/group-room-view" element={<GroupRoomView />} />


        {/* <Route path="/service" element={<RoomView />} /> */}
        {/* <Route path="/contact" element={<RoomView />} /> */}
        {/* <Route path="/book-room" element={<RoomView />} /> */}




      </Routes>
    </Router>
  );
};

export default AppRouter;
